import React from "react";
import cssClasses from "./home.module.scss";
import Link from "next/link";
import styled, { css } from "styled-components";
import NavLink from "../Components/NavLink/NavLink";
import {
  MyLink,
  MyButton,
  CoolTitle,
  Section,
  DangerButton,
} from "../Components/StyledComponents/styledComponents";

const RedLink = styled.input.attrs((props) => ({
  type: "number",
  size: 100,
  placeholder: "Your number",
}))`
  color: red;
  text-decoration: none;
  ${(props) =>
    props.fucker &&
    css`
      color: purple;
      padding: 0.3rem;
      outline: none;
      border-width: 1px;
      ::-webkit-inner-spin-button,
      ::-webkit-outer-spin-button {
        -webkit-appearance: none;
      }
      ::placeholder {
        color: purple;
      }
      &:focus {
        border-color: red;
        border-width: 1px;
        padding: 0.3rem;
      }
    `}
`;

const Test = styled.button(
  ({ jobes, height }) => `
color: ${jobes};
height: ${height}
`
);

const ClonedRedLink = styled(RedLink)``;

const StyledDiv = styled.div.withConfig({
  shouldForwardProp: (prop, defaultValidatorFn) =>
    !["jobes"].includes(prop) && defaultValidatorFn(prop),
})`

  ${({ jobes }) => `
 background-color: ${jobes}
 `}
`;

const App = () => {
  return (
    <div className={cssClasses.Joblers}>
      <h1 className={cssClasses.Joblers__title}>Hello NextJs</h1>
      <RedLink fucker />
      <Link href={{ pathname: "/about", query: { name: "test" } }}>
        <a>About us</a>
      </Link>
      <StyledDiv jobes="yellow" $height="200" $width="400">
        Styled Div
      </StyledDiv>
      {/* <ClonedRedLink as="div">Hallo</ClonedRedLink>
        <NavLink myText="My Text!!">About us (custom)</NavLink>
        <MyLink primary>About us (Styled)</MyLink>
        <Testing primary>Testing with styled props</Testing>
        <MyButton type="danger">Fucking button</MyButton>
        <CoolTitle className={cssClasses.Joblers__title}>Cool Title</CoolTitle>
        <DangerButton as="p">Danger Button</DangerButton>
        <Section>Hello</Section> */}
    </div>
  );
};

export default App;
